// Layout.js
import React from "react";
import Navbar from "./Navbar";
import "./layout.css"; // Optional: Add styling for layout if needed
import { Link } from "react-router-dom";

const Layout = ({ children }) => {
  return (
    <div className="layout-container">
      <Navbar />
      <main className="content">{children}</main>
      <footer className="footer-container">
  <div className="footer-content">
    <p>&copy; 2024 Dental Expert System. All rights reserved.</p>
    <div className="contact-links">
      <a href="mailto:info@healthydental.com" className="contact-link">
        <i className="fa fa-envelope"></i> Email Us
      </a>
      <a href="tel:+1234567890" className="contact-link">
        <i className="fa fa-phone"></i> Call Us
      </a>
      <a href="https://facebook.com/healthydental" target="_blank" rel="noopener noreferrer" className="contact-link">
        <i className="fa fa-facebook"></i> Facebook
      </a>
      <a href="https://instagram.com/healthydental" target="_blank" rel="noopener noreferrer" className="contact-link">
        <i className="fa fa-instagram"></i> Instagram
      </a>
    </div>
  </div>
</footer>
    </div>
  );
};

export default Layout;
